window.bookSummaryJSON = "<p>The enthralling and romantic sequel to J.M. Kearl's enchanting Bow Before the Elf Queen.</p> <p>Layala fought against falling in love with him. Thane battled to win his mate's heart. Now they'll discover if their love can withstand those who tore them apart.</p> <p>Held for weeks without food or water, Layala's resolve begins to fracture as an evil darkness looms over her. She’s the key to destroying the Void or reviving its creator— the long-dead Black Mage she has a mysterious connection to.</p> <p>Layala and Thane learn what it truly means to fight for love as their enemies surround them and it becomes a struggle for revenge, the kingdom, and finding the truth about why Layala seems to harbor the power of whether Palenor falls into darkness or if her Lightbringer name holds true.</p> <p>Author's note: Long Live the Elf Queen is book 2 in the Elf Queen series and ends on a cliffhanger. It contains romantic steam, violence, war, and mature themes with morally grey characters.</p>"; 
